//SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;

contract Multisend {

    address public owner;

    uint public total_value;

    //Events
    event OwnerSet(
        address indexed oldOwner,
        address indexed newOwner
    );

    event Withdrawal(
        address payable[] indexed recipients,
        uint[] indexed values
    );  

    constructor() payable {
        owner = msg.sender;
        emit OwnerSet(address(0), owner);

        total_value = msg.value;
    }

    //MODIFIERS
    modifier onlyOwner() {
        require(msg.sender == owner, "Not authorized");
        _;
    }

    function sum(uint[] memory amounts) private pure returns(uint totVal) {
        uint totalAmount = 0;

        for (uint i=0; i < amounts.length; i++){
            totalAmount += amounts[i];
        }

        return totalAmount;
    }

    function withdraw(address payable _to, uint _amount) private  {
        _to.transfer(_amount);
    }

    function withdrawals(address payable[] memory addrs, uint[] memory amnts) payable public onlyOwner{

        total_value += msg.value;

        require(addrs.length == amnts.length, "Number of recipients and transactions must be the same");

        uint totalAmnt = sum(amnts);

        require(total_value >= totalAmnt, "Not enough balance to send");

        for(uint i = 0; i < addrs.length; i++) {
            total_value -= amnts[i];

            withdraw(addrs[i], amnts[i]);
        }

        emit Withdrawal(addrs, amnts);
    }

    receive() external payable {
        total_value += msg.value;
    }

}
